// import * as $ from 'jquery';
import { Container, Form } from 'react-bootstrap';


function Hash() {
    return (
        <Container>
            <Form onChange={(event) => {
                event.preventDefault();
                console.log(this.input.value);
            }}>
                <Form.Group>
                    <Form.Label>
                        Data: 
                    </Form.Label>
                    <Form.Control ref={(input) => this.input = input} type="text" placeholder="" />
                </Form.Group>

                <Form.Group>
                    <Form.Label>
                        Hash: 
                    </Form.Label>
                    <Form.Control type="hash" placeholder= {sha256('')} />
                </Form.Group>
            </Form>
        </Container>
    );
}

export default Hash;
